import React from 'react';
import Logo from '../assetsLogo Escrito Azul PNG.png'; // Importe a imagem aqui
import '../styles/Header.css'; // Importe o arquivo CSS diretamente

function Header() {
    return (
        <main>
            <nav className="menu-principal">
                <div className="menu-links">
                    {/* Use a variável Logo aqui */}
                    <img src={Logo} alt="Logo" className="logteste" />
                    <input type="text" name="ms" className="busca-topo" placeholder="Pesquisa" />
                </div>
            </nav>
        </main>
    );
}

export default Header;
